import React, { useState } from 'react'
import { Button, TextField, Grid } from '@material-ui/core'
import { Formik , Form} from 'formik'
import { PropObject } from '../../generated/graphql'



interface Props {
    property: PropObject;
    onSubmit: (values: PropObject) => void;
}



export const PropertyForm: React.FC<Props> = (props) => {

    const [prop, setProp] = useState(props.property);
    setProp(props.property);

    return (
        <Formik initialValues={prop} onSubmit={(values: PropObject) => {
            props.onSubmit(values);
        }}>
            {({values, handleChange, handleBlur}) => (
            <Form>
                <Grid container direction="column" spacing={4}>
                        <Grid item>
                            <TextField 
                                    name="id"
                                    label="Property ID"
                                    value={values.id} 
                                    onChange={handleChange}
                                    onBlur={handleBlur}
                                />
                        </Grid>
                        <Grid item>
                            <TextField 
                                    label="Titel"
                                    name="title"
                                    value={values.title} 
                                    onChange={handleChange}
                                    onBlur={handleBlur}
                                />
                        </Grid>
                        <Grid item>
                            <TextField 
                                    label="Subtext"
                                    name="subtext"
                                    value={values.subtext} 
                                    onChange={handleChange}
                                    onBlur={handleBlur} 
                                />
                        </Grid>
                        <Grid item>
                            <TextField 
                                    label="Ortsname"
                                    name="location"
                                    value={values.location} 
                                    onChange={handleChange}
                                    onBlur={handleBlur}
                                />
                        </Grid>
                        <Grid item>
                            <TextField 
                                    label="Longitude"
                                    name="long"
                                    value={values.long} 
                                    onChange={handleChange}
                                    onBlur={handleBlur}
                                />
                        </Grid>
                        <Grid item>
                            <TextField 
                                    label="Latitude"
                                    name="lat"
                                    value={values.lat} 
                                    onChange={handleChange}
                                    onBlur={handleBlur}
                                />
                        </Grid>

                        <Grid item>
                            <Button variant="contained" type="submit">
                                speichern
                            </Button>
                        </Grid>
                    </Grid>   
            </Form>


            ) }

        </Formik>
    )


}

